                                    <div class="element">La GRH <span class="rouge">autrement</span></div>
                                    <div class="element">Apprenez <span class="rouge">mieux</span></div>

                                </div>
    
                             </div>
    
                        </div>
    
                    </div>
                </div>
        )
    }
}
